import React from 'react';
import './App.css';
import Home from './Pages/Home';
import Room from './Pages/Room';
import Host from './Pages/Host';
import Error from './Pages/Error';

function App() {
  return (
    <>
      <Home />
      <Room />
      <Host />
      <Error />
    </>
  );
}

export default App;
